import React, { useCallback, useState } from 'react';


// Example dictionary of folders and files
const initialFolders = {
    'Documents': ['doc1.txt', 'doc2.txt', 'report.pdf'],
    'Photos': ['photo1.jpg', 'photo2.png'],
    'Music': ['song1.mp3', 'song2.wav', 'album1.zip'],
  };

const FolderIcon = ({ name, fileCount, onView }) => (
<div>
    <div>
    <img src="folder-icon.png" alt="Folder" />
    <p>{name}</p>
    <p>{fileCount} files</p>
    </div>
    <button onClick={onView}>Open</button>
</div>
);

const Folder = () => {
  return (
    <div style={styles.container}>
      {/* Header */}
      <header style={styles.header}>
        <h1 style={styles.title}>AcquiSolar</h1>
        <a href="/about" style={styles.aboutLink}>About Us</a>
      </header>
      <div style={styles.folderContainer}>
          {Object.keys(folders).map((folderName) => (
            <FolderIcon
              key={folderName}
              name={folderName}
              fileCount={folders[folderName].length}
              onView={() => handleViewFolder(folderName)}
            />
          ))}
        </div>
    </div>
  );
};

const styles = {
  container: {
    fontFamily: 'Arial, sans-serif',
    height: '100vh',
    width: '100%',
    backgroundColor: '#7AA6B9',
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'flex-start',
  },
  header: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '20px',
    color: 'white',
    fontSize: '24px',
  },
  title: {
    margin: 0,
  },
  aboutLink: {
    color: 'white',
    textDecoration: 'none',
    backgroundColor: '#7AA6B9', 
    padding: '5px 10px',
    borderRadius: '5px', 
  },
  content: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'flex-start', 
    padding: '20px',
    paddingTop: '10px',
    width: '100%',
  },
  mainContent: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '20px',
    paddingTop: '10px',
  },  
  folderContainer: {
    flex: 1,

  }
};

export default Folder;
